import React from 'react';
import styled from 'styled-components';
import Logo from '../header/Logo.js';
import Thumbnail from './Thumbnail.js';

import {
  Switch,
  Route,
  Link,
} from 'react-router-dom';

const MainPageS = styled.div`
  display: flex;
  flex-wrap: wrap;

  width: 100%;
  height: 100vh;
  margin-top: 8%;
  flex-direction: row;
  justify-content: center;
  align-items: center;
`;

const TitleS = styled.div`
  display: flex;
  font-family: 'bitbit';
  vertical-align: bottom;
  align-items:center;
  width : ${(props) => props.width};
  height: 36px;
  cursor: pointer;
  margin-left: ${(props) => props.marginleft};
  text-align: center;
  font-weight: 1;
  font-size: 300%;
  color: ${(props) => props.color};
`;

const UnderLineS = styled.div`
  border-bottom: dashed;
  width: 80%;
  height: 0px;
  margin-top: ${(props) => props.margintop};
`;

const AreaS = styled.div`

`;

const BlockS = styled.input`
  width: ${(props) => props.width || '90%'};
  height: ${(props) => props.height};
  border: 2px solid #bbb;
  box-sizing: border-box;
  border-radius: 6px;
  font-size: 2vh;
  text-align: center;
  margin-top: ${(props) => props.margintop};
  margin-left: ${(props) => props.marginleft};
`;

const ButtonS = styled.button`
  padding:  ${(props) => props.padding || '2% 0px'};
  cursor: pointer;
  width: ${(props) => props.width || '80%'};
  height: ${(props) => props.height};
  border: 2px solid #bbb;
  border-radius: 6px; 
  text-align: center;
  margin-top: ${(props) => props.margintop};
  margin-left: ${(props) => props.marginleft};
`;

const BlankS = styled.div`
  width: ${(props) => props.width};
  height: ${(props) => props.height};
  margin-top: ${(props) => props.margintop};
  margin-left: ${(props) => props.marginleft};
  background: ${(props) => props.background};
  display: ${(props) => props.display};
  justify-content: center;
  flex-direction: ${(props) => props.fd};
  font-size: ${(props) => props.fontsize};
  line-height: ${(props) => props.lineheight || '100%'};
  text-align: ${(props) => props.textalign || 'center'};  
  font-family:'bitbit';
`;

const NavButtonS = styled.div`
  cursor: pointer;
  text-align : center;
  width: 10%;
  height: 5%;
  font-size: 16px;
  text-align: center;
  font-family:'bitbit';
  font-weight: 1;
  margin-left: ${(props) => props.marginleft};
  margin-right: ${(props) => props.marginright};
  margin-top: ${(props) => props.margintop};
  color: ${(props) => props.color};
`;

const IconBoxS = styled.img`
  width: ${(props) => props.width};
  height: ${(props) => props.height};
  margin-left: ${(props) => props.marginleft};
  margin-right: ${(props) => props.marginright};
  margin-top: ${(props) => props.margintop};
  border: 2px solid #bbb;
  box-sizing: border-box;
`;

function repeatThumbnail() {
  let array = [];

  for (let i=0; i<5; i++){
    array.push(<Thumbnail marginleft='1%'></Thumbnail>)
  }

  return array;
}

